import { createUseStyles } from "react-jss";
import clsx from "clsx";

const useStyles = createUseStyles({
  searchTasks__bar: {
    display: "flex",
    top : "150%",
    right: "0",
    width: "30rem",
    paddingRight: "1.3rem",
    borderRadius: "1.3rem",
    border: "3px solid var(--background-color-header)",
  },
  searchTasks__button: {
    padding: "0.3rem",
    borderRadius: "0.7rem",
    display: "flex",
  },
});

export default function SearchTask() {
  return (
    <div
      className="searchTasks__bar position-absolute align-items-center"
      style={{}}
    >
      <div className="searchTasks__input w-100">
        <input
          type="text"
          placeholder="Input tasks name"
          className="w-100 input--none-border"
          style={{
            fontSize: "1.6rem",
          }}
        />
      </div>

      <div className="searchTasks__button">
        <ion-icon
          name="search"
          style={{
            fontSize: "2rem",
            cursor: "pointer",
          }}
        ></ion-icon>
      </div>
    </div>
  );
}
